import React from "react";

class Jobslist extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        jobs: [],

      };
    }

    componentDidMount() {
        fetch("http://localhost:8080/jobs/status/S",{mode:'no-cors'})
          .then(res => res.json())
          .then(
            (result) => {
              this.setState({
                isLoaded: true,
                items: result
              });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
              this.setState({
                isLoaded: true,
                error
              });
            }
          )
      }

      render() {
        const { error, isLoaded, jobs } = this.state;
        if (error) {
          return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
          return <div>Loading...</div>;
        } else {
          return (
            <ul>
              {jobs.map(job => (
                <li key={job.id}>
                  {job.jobName} {job.status}
                </li>
              ))}
            </ul>
          );
        }
      }
    }

    export default Jobslist;
